import './style.scss';

function alertDownload() {
  return (
    <section className="alert__container">
      <section className="alert">
        <h1 className="alert__title">Escolha uma extens√£o</h1>
        <select className="alert__select" name="" id="">
          <option value="">png</option>
        </select>
        <div className="alert__buttons">
          <button className="alert__buttons__button-ok alert__buttons__button" type="button">Ok</button>
          <button className="alert__buttons__button-cancel alert__buttons__button" type="button">Cancel</button>
        </div>
      </section>
    </section>
  )
}

export default alertDownload
